INSERT INTO `a_curriculum` VALUES ('1780150064459681792', 'admin', '2024-04-16 16:23:43.616000', 0, NULL, NULL, 'C 语言是一种通用的、面向过程式的计算机程序设计语言。', 'http://127.0.0.1:8080/zwz/file/view/1780149965667045376', '正常', 'C语言程序设计');
INSERT INTO `a_curriculum` VALUES ('1780423441187475456', 'admin', '2024-04-17 10:30:01.708000', 0, NULL, NULL, 'C++ 是一种高级语言，它是由 Bjarne Stroustrup 于 1979 年在贝尔实验室开始设计开发的。C++ 进一步扩充和完善了 C 语言，是一种面向对象的程序设计语言。C++ 可运行于多种平台上，如 Windows、MAC 操作系统以及 UNIX 的各种版本。', 'http://127.0.0.1:8080/zwz/file/view/1780423426780041216', '正常', 'C++程序设计');
INSERT INTO `a_curriculum` VALUES ('1780424101748412416', 'admin', '2024-04-17 10:32:39.196000', 0, NULL, NULL, 'Python 是一种解释型、面向对象、动态数据类型的高级程序设计语言。', 'http://127.0.0.1:8080/zwz/file/view/1780424096023187456', '正常', 'Python程序设计');
INSERT INTO `a_curriculum` VALUES ('1780424258334363648', 'admin', '2024-04-17 10:33:16.529000', 0, NULL, NULL, 'Java 是由 Sun Microsystems 公司于 1995 年 5 月推出的高级程序设计语言。\n\nJava 可运行于多个平台，如 Windows, Mac OS 及其他多种 UNIX 版本的系统。', 'http://127.0.0.1:8080/zwz/file/view/1780424253645131776', '正常', 'Java程序设计');
INSERT INTO `a_curriculum` VALUES ('1786316443323863040', 'admin', '2024-05-03 16:46:42.000000', 0, 'admin', '2024-07-02 15:49:32.887000', 'Oracle数据库系统是美国Oracle公司（甲骨文）提供的以分布式数据库为核心的一系列软件产品，是目前世界上使用最为广泛的数据库管理系统，具备完整的数据管理功能，真正实现了分布式处理功能', 'http://127.0.0.1:8080/zwz/file/view/1808045254562156544', '正常', 'Oracle数据库应用与开发');
